import React from "react";
import Navbar from "./Navbar";
import { BrowserRouter, Link, Route, Routes,Switch } from "react-router-dom";
import Home from "./Home";
const Header = () => {
  return (
    <BrowserRouter>
      <Navbar />
      <Switch>
        <Route path="/" element={<Home />} />
      </Switch>
    </BrowserRouter>
  );
};

export default Header;
